import { Outlet } from 'react-render-dom';
import Directory from "../../components/directory/directory.component.jsx";

const Home=()=>{

  const categories=[
    {
      id:1,
      title:"Light",
      imageUrl:"data:image/jpeg;base64,"
    },
    {
      id:2,
      title:"Mid-sized",
      imageUrl:"data:image/jpeg;base64,"
    },
    {
      id:3,
      title:'Heavy',
      imageUrl:"data:image/jpeg;base64,"
    },
    {
      id:4,
      title:'Ultra-long-range',
      imageUrl:"data:image/jpeg;base64,"
    },
    {
      id:5,
      title:'Executive Airliners',
      imageUrl:"data:image/jpeg;base64,"
    },
  ]

  return (
    <div>
      <Outlet/>
      <Directory categories={categories}/>
    </div>
  )
}

export default Home;
